Waiting On Love (NEW 2014 Wicked Pictures) [DVDRip]

Carter Cruise, Steven St Croix, Michael Vegas, Karlie Montana, Nikki Daniels, Chad White

As 'good girl' Ally's romance ends badly, she has no interest in starting a new one. Her best friend/roommate however, has no such concerns, as she eyes a hot, new neighbor Mason. Mason isn t interested because he s holding out hope that he ll reconcile with his estranged wife. Over time, a friendship develops between Ally and Mason and although they are afraid to admit they have fallen for each other it happens! Just when it seems things may work out, the love Mason has been waiting for returns. Emotions are raw as fate, destiny and love determine what happens next!

